import { StatusBar } from 'expo-status-bar';
import React, {useState} from 'react';
import { StyleSheet, Text, View, Button, Pressable } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={ styles.titleText}>Welcome to Door 2 Door !!</Text>
      <Pressable style={styles.buttonStyle}>
      <Text style={ styles.titleText}>Search by Vendor</Text>
      </Pressable>
      <Button title="Vendors Near Me" style={styles.buttonStyle}></Button>
      <Button title="Search by Location" style={styles.buttonStyle}></Button>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'black',
    alignItems: 'center',
    justifyContent: 'center',
   // width:'auto',
   // height: 'auto',
  },
  titleText: {
    fontSize:25,
    fontFamily:'lucida grande',
    fontWeight:'bold',
    color:'white',
    justifyContent:'center'
  },
   buttonStyle: {
    alignItems: 'center',

    justifyContent: 'center',
    paddingVertical: 12,
    paddingHorizontal: 10,
    borderRadius: 4,
    elevation: 3,
    fontSize:20,
    fontFamily:'lucida grande',
    fontWeight:'bold',
    backgroundColor:'white',
  },
  buttonText: {
    fontWeight:'bold',
    color:'black',
  }
});
